import React, { Component } from 'react';
import { BrowserRouter as Router } from "react-router-dom";
import Switch from "react-router-dom/es/Switch";
import Route from "react-router-dom/es/Route";
import ListProjectComponent from "./ListProjectComponent";
import TopNavBar from "./TopNavBar";
import AuthenticationService from "./AuthenticationService";
import jwt_decode from "jwt-decode";
import {withRouter} from 'react-router-dom';
import StudentService from "./StudentService";

class StudentPage extends Component{
    constructor(props) {
        super(props);
        const user = AuthenticationService.getCurrentUser();

        if (user) {
            const decode = jwt_decode(user.token)
            const role = decode.role
            if (role === "company") {
                props.history.push("/company")
            }
        } else {
            props.history.push("/login")
        }

        this.state = {
            projectList : []
        }
    }
    componentDidMount() {

    }

    render() {
        StudentService.getStudentProjects().then(response => {
            this.setState({
                projectList: response.data
            });
            console.log(this.state.projectList)
        })

        return (
            <div className="App">
                <TopNavBar />
                This is a student page
                <ListProjectComponent projectList={this.state.projectList}/>
                {/*<Router>*/}
                {/*    <Switch>*/}
                {/*        <Route path="/student" exact component={ListProjectComponent} projectList={this.state.projectList}/>*/}
                {/*    </Switch>*/}
                {/*</Router>*/}
            </div>
        )
    }
}

export default withRouter(StudentPage);
